webpackJsonp([0x930d52cd9c2a],{5213:function(e,t){e.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/02/WinniePooh.jpg" height="262" width="350" border="0" alt="Winnie Pooh: " /></p>\n<p><i>Dad sure writes a lot about me. But he hasn\'t posted any pictures lately. I finally talked Mom into posting one of my latest pictures.<br />\nHere I\'m sitting in my favorite leather chair and catching up on Winnie Pooh\'s adventures. The book is a gift from my Uncle Steve and Aunt Shannon. They must be having fun shoveling snow in Minnesnowta! Just wanted to say Hi to everybody out there in the Weblog Community!</i></p>',fields:{title:"Hello Everybody",date:"26 Feb 2001",url:"https://papascott.de/2001-02-26-hello-everybody/"}}},pathContext:{slug:"/2001-02-26-hello-everybody/",prev:{fields:{title:"Long for your Kiss",date:"24 Feb 2001",slug:"/2001-02-24-long-for-your-kiss/"}},next:{fields:{title:"U Don't Have 2 B Beautiful",date:"03 Mar 2001",slug:"/2001-03-03-u-dont-have-2-b-beautiful/"}}}}}});
